import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { Chart as ChartJS, CategoryScale, LinearScale, BarElement, ArcElement, Title, Tooltip, Legend, PointElement, LineElement } from 'chart.js';
import { Bar, Doughnut, Line } from 'react-chartjs-2';

ChartJS.register(CategoryScale, LinearScale, BarElement, ArcElement, Title, Tooltip, Legend, PointElement, LineElement);

const DashboardContainer = styled.div`
  padding: 40px;
  background: linear-gradient(135deg, #f8fafc 0%, #e2e8f0 100%);
`;

const SectionTitle = styled.h2`
  font-family: 'Merriweather', serif;
  font-size: 2.2rem;
  color: #0f766e;
  margin-bottom: 15px;
  text-align: center;
`;

const SectionSubtitle = styled.p`
  font-size: 1.1rem;
  color: #64748b;
  text-align: center;
  margin-bottom: 40px;
  line-height: 1.6;
`;

const KeyMetricsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
  gap: 25px;
  margin-bottom: 40px;
`;

const MetricCard = styled(motion.div)`
  background: white;
  border-radius: 20px;
  padding: 30px;
  box-shadow: 0 10px 30px rgba(0,0,0,0.1);
  border-left: 5px solid ${props => props.color || '#0f766e'};
  text-align: center;
`;

const MetricValue = styled.div`
  font-size: 2.8rem;
  font-weight: 700;
  color: #1f2937;
  margin-bottom: 10px;
`;

const MetricLabel = styled.div`
  font-size: 1.1rem;
  color: #4b5563;
  font-weight: 600;
  margin-bottom: 8px;
`;

const MetricDescription = styled.div`
  font-size: 0.9rem;
  color: #6b7280;
  line-height: 1.4;
`;

const ChartsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(500px, 1fr));
  gap: 30px;
  margin-bottom: 40px;
`;

const ChartContainer = styled(motion.div)`
  background: white;
  border-radius: 20px;
  padding: 30px;
  box-shadow: 0 10px 30px rgba(0,0,0,0.1);
  border: 1px solid #e2e8f0;
`;

const ChartTitle = styled.h4`
  font-size: 1.4rem;
  color: #0f766e;
  margin-bottom: 25px;
  text-align: center;
  font-family: 'Merriweather', serif;
`;

const HighlightSection = styled(motion.div)`
  background: linear-gradient(135deg, #ecfdf5, #d1fae5);
  border-radius: 20px;
  padding: 35px;
  margin: 30px 0;
  border-left: 5px solid #10b981;
`;

const HighlightTitle = styled.h3`
  font-size: 1.6rem;
  color: #065f46;
  margin-bottom: 20px;
  font-family: 'Merriweather', serif;
`;

const HighlightGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  gap: 25px;
`;

const HighlightItem = styled.div`
  background: rgba(255, 255, 255, 0.7);
  padding: 20px;
  border-radius: 12px;
`;

const HighlightMetric = styled.div`
  font-size: 2rem;
  font-weight: 700;
  color: #065f46;
  margin-bottom: 8px;
`;

const HighlightDescription = styled.div`
  font-size: 0.95rem;
  color: #047857;
  line-height: 1.5;
`;

const CHCWorkforceDashboard = () => {
  const workforceGrowthData = {
    labels: ['2016', '2017', '2018', '2019', '2020', '2021'],
    datasets: [
      {
        label: 'Total Workforce',
        data: [22027, 23104, 24389, 25698, 27156, 28668],
        borderColor: '#0f766e',
        backgroundColor: 'rgba(15, 118, 110, 0.1)',
        tension: 0.4,
        fill: true,
      }
    ]
  };

  const providerTypeData = {
    labels: ['Family Physicians', 'Nurse Practitioners', 'OB/GYNs', 'Physician Assistants', 'Internal Medicine', 'Others'],
    datasets: [{
      data: [8634, 7923, 4412, 3287, 2156, 2256],
      backgroundColor: [
        '#0f766e',
        '#14b8a6',
        '#06b6d4',
        '#3b82f6',
        '#8b5cf6',
        '#ec4899'
      ],
      borderWidth: 0,
      hoverOffset: 10
    }]
  };

  const growthByTypeData = {
    labels: ['Family Physicians', 'Nurse Practitioners', 'OB/GYNs', 'Physician Assistants'],
    datasets: [{
